import React, { Fragment } from 'react';
import { Nav, Container, Navbar, Image, Row, Col } from 'react-bootstrap'


const HomeSideBar = () => {
    return (
        <div>
            <Container Fluid>
                <button className='btn hover-shadow' href="#auth0" style={{
                    background: '#93B5C6',
                    border: 'none',
                    fontSize: '18px',
                }}>
                </button>
            </Container>
        </div>
    )
};

export default HomeSideBar;
